☆Minha sede de liberdade é do tamanho das asas imaginárias, criadas pelos meus mais livres pensamentos...
.
☆Perto de completar 50 anos, desejei fazer um voo de asa delta, no Rio de Janeiro. Um dia desses, numa reprise de novela, vi uma cena com essa imagem e até me emocionei. Gostaria de ter tido coragem. Mas recuei da ideia.
.
☆Eu queria voar, mas o céu parece grande demais. Eu queria voar, mas o chão também parece grande demais. Se eu pudesse somente voar livre, na segurança de um pouso tranquilo, quando precisasse de chão, eu voaria. Mas o chão pode ser nada acolhedor, para almas livres... O chão das "certezas", dos dogmas, dos modelos mentais, das regras, tantas regras...
.
☆Eu queria voar! 
.
✍🏽Mariângela Carvalho
