Com um aroma único e exótico, o Vetiver é conhecido por proporcionar um efeito calmante e fundamental nas emoções - tornando-o ideal para massagens terapêuticas e promovendo um sono reparador.

Usos
•	Use como um óleo de massagem para acalmar as emoções. •	Tome um banho morno com algumas gotas de óleo essencial de Vetiver para relaxamento profundo. •	Difusa com Lavanda, doTERRA Serenity ® ou doTERRA Balance ®  para acalmar emoções e diminuir o estresse. •	Use um palito para ajudar a tirar a quantidade desejada do recipiente se o Vetiver for muito grosso para sair da garrafa. Um pouco vai um longo caminho.
Instruções de uso

Difusão: Use três a quatro gotas no difusor de sua escolha. 
Uso interno: Dilua uma gota em 4 fl. oz. de líquido. 
Uso tópico: Aplique uma a duas gotas na área desejada. Dilua com óleo de coco fracionado doTERRA para minimizar qualquer sensibilidade da pele.
Cuidados
Sensibilidade da pele possível. Mantenha fora do alcance de crianças. Se você estiver grávida, amamentando ou sob cuidados de um médico, consulte seu médico. Evite o contato com os olhos, ouvidos internos e áreas sensíveis. .
